import PropTypes from "prop-types";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  useParams,
} from "react-router-dom";
const Detail = ({ products, onDetail }) => {
  let { id, name } = useParams();
  console.log(products);
  const onHandleDetail = (id) => {
    onDetail(id);
  };

  return (
    <div>
      {id}
      {name}
    </div>
  );
};
Detail.propTypes = {};

export default Detail;
